void enqueue_dequeue_frame::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"operation\" :  \"" << operation.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ac\" :  \"" << ac.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"inout_frame_address0\" :  \"" << inout_frame_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"inout_frame_ce0\" :  \"" << inout_frame_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"inout_frame_we0\" :  \"" << inout_frame_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"inout_frame_d0\" :  \"" << inout_frame_d0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"inout_frame_q0\" :  \"" << inout_frame_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_return\" :  \"" << ap_return.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

